import styled from 'styled-components'

export const ComercioWrapper = styled.div`
  width:100%;
  height:100vh;
  padding:18% 0% 4% 0%;
`;
export const PortadaComercio = styled.div`
  background-image:url('/bar4.jpg');
  background-position:center;
  background-size:cover;
  width:100%;
  height:30vh;
  @media (max-width: 600px) {
    
    }
`;
export const Carta = styled.div`
width:100%;
padding:2vh 0 2vh 0;
`;

export const ItemCarta = styled.div`
  background: #b2c5f9;
  border-radius:30px;
  width:auto;
  height:4vh;
  text-align:center;
  padding:10px;
  font-family:'Karla', sans-serif;
  color: #333;
  font-weight:600;
  margin:6px;
`;
export const CartaList = styled.div`
  width:100%;
  height:70vh;
  padding:6px;
  background: #b2c5f9;
  border-radius:5px;

`;
export const ItemProduct = styled.div`
  display:grid;
  grid-template-columns:60% 40%;
  
`;
export const ItemNamePrice = styled.div`
display:grid;
grid-template-rows:1fr 1fr;
grid-row-gap:5px;
`;
export const ItemAdd = styled.div`
display:grid;
grid-template-columns:80% 1fr;

`;
export const ProductImg = styled.img`
  width:10vw;
`;
